      End-If;
   End-For;
Else
   SWTCHUSR_DV.GROUPBOX.Visible = False;
   SWTCHUSR_DV.GROUPBOX1.Visible = True;

   Local string &newUrl = &objSignon.getRedirectURL();

   ViewURL(&newUrl, False);
End-If;

